(378, 11, '<p>We have a day in which we analyze everything around us.</p>', '<p>We have a day in which we analyze everything around us.</p>', 1, '1', '0', 1648878797, NULL),
(379, 11, '<p>An emotion related to a past event may reappear.</p>', '<p>An emotion related to a past event may reappear.</p>', 1, '1', '0', 1648878804, NULL),
(380, 10, '<p>It was after a rich lunch. Voltaie had cheered the whole court of King Friederich II with all sorts of jokes about religion, and, getting up in the afternoon, he added, &quot;Here!&quot; I would sell my place in Heaven for a gold pole! An old, white-haired officer, who had never spoken before, could not keep quiet. . Prove to me that you have a place in Heaven and I&#39;ll buy it for you right away. No one laughed anymore. And the thoughtful king said: The colonel is right, gentlemen. Most of my victories would make me less happy than to know that my people remained as faithful as they were when I ascended the throne!</p>', '<p>It was after a rich lunch. Voltaie had cheered the whole court of King Friederich II with all sorts of jokes about religion, and, getting up in the afternoon, he added, &quot;Here!&quot; I would sell my place in Heaven for a gold pole! An old, white-haired officer, who had never spoken before, could not keep quiet. . Prove to me that you have a place in Heaven and I&#39;ll buy it for you right away. No one laughed anymore. And the thoughtful king said: The colonel is right, gentlemen. Most of my victories would make me less happy than to know that my people remained as faithful as they were when I ascended the throne!</p>', 1, '1', '0', 1648878841, NULL),
(381, 10, '<p>A lady was going on a long carriage ride through a dense forest. It was night, a darkness of no light. He heard strange noises. He thought he saw the ghosts running through the darkness. Her heart was pounding. She was terrified. However visit the horse&#39;s hand without fear. - How do you see the road? she asked him late, expecting misfortune all the time. &quot;Easy,&quot; he replied, &quot;look up!&quot; My path is drawn to the sky by the tops of the fir trees. So let&#39;s look up; that&#39;s where the Light comes from.</p>', '<p>A lady was going on a long carriage ride through a dense forest. It was night, a darkness of no light. He heard strange noises. He thought he saw the ghosts running through the darkness. Her heart was pounding. She was terrified. However visit the horse&#39;s hand without fear. - How do you see the road? she asked him late, expecting misfortune all the time. &quot;Easy,&quot; he replied, &quot;look up!&quot; My path is drawn to the sky by the tops of the fir trees. So let&#39;s look up; that&#39;s where the Light comes from.</p>', 1, '1', '0', 1648878848, NULL),
(382, 10, '<p>A frog lived all its life in a fountain. One day, he woke up with a different kind of frog. - Where did you come from? she asked. - From the sea. That&#39;s where I live. - How&#39;s the sea? Is it as big as my fountain? The new frog began to laugh. &quot;There&#39;s no room for comparison.&quot; The host frog pretended to be interested in the stories of the newcomer, but she thought to herself: Of all the liars I&#39;ve ever met in my life, this is definitely the biggest - and the most shameless.</p>', '<p>A frog lived all its life in a fountain. One day, he woke up with a different kind of frog. - Where did you come from? she asked. - From the sea. That&#39;s where I live. - How&#39;s the sea? Is it as big as my fountain? The new frog began to laugh. &quot;There&#39;s no room for comparison.&quot; The host frog pretended to be interested in the stories of the newcomer, but she thought to herself: Of all the liars I&#39;ve ever met in my life, this is definitely the biggest - and the most shameless.</p>', 1, '1', '0', 1648878855, NULL),
(383, 10, '<p>Once, four disciples wanted to compete. Said and done. They all sat down in a room and decided that for three days no one would say a word, so that they could try their patience and concentration. But in the evening, when it began to get dark, one could not help but say, &quot;Let someone turn on the light!&quot; The second one asked puzzled. - Fools, why did you talk? - the third rushed to rebuke them. - Hey, only I was silent! - boasted the fourth. Each disciple fell prey to temptation: haste, mistrust, anger, and pride &mdash; the four temptations that plague humans all the time. Therefore, patience is the best companion in life, whether you work, study, or pray.</p>', '<p>Once, four disciples wanted to compete. Said and done. They all sat down in a room and decided that for three days no one would say a word, so that they could try their patience and concentration. But in the evening, when it began to get dark, one could not help but say, &quot;Let someone turn on the light!&quot; The second one asked puzzled. - Fools, why did you talk? - the third rushed to rebuke them. - Hey, only I was silent! - boasted the fourth. Each disciple fell prey to temptation: haste, mistrust, anger, and pride &mdash; the four temptations that plague humans all the time. Therefore, patience is the best companion in life, whether you work, study, or pray.</p>', 1, '1', '0', 1648878872, NULL),
(384, 10, '<p>An old man heard a child talking badly to his playmates and swearing. Stopping, he asked, &quot;If someone spoke English, what would you think of him?&quot; &quot;He&#39;s an Englishman,&quot; the boy replied. - What if someone spoke Spanish? - He would be a Spaniard, of course. - Don&#39;t you think it&#39;s the same with the one who speaks the &quot;language&quot; of God? A believer says only beautiful and useful things. From the bad man, on the other hand, you hear only ugly words, swear words and lies. As is the soul of man, so is his word. Be careful what you say, because sooner or later you will be among those whose language you speak! You can reach between sinners and devils or between angels and saints.</p>', '<p>An old man heard a child talking badly to his playmates and swearing. Stopping, he asked, &quot;If someone spoke English, what would you think of him?&quot; &quot;He&#39;s an Englishman,&quot; the boy replied. - What if someone spoke Spanish? - He would be a Spaniard, of course. - Don&#39;t you think it&#39;s the same with the one who speaks the &quot;language&quot; of God? A believer says only beautiful and useful things. From the bad man, on the other hand, you hear only ugly words, swear words and lies. As is the soul of man, so is his word. Be careful what you say, because sooner or later you will be among those whose language you speak! You can reach between sinners and devils or between angels and saints.</p>', 1, '1', '0', 1648878879, NULL),
(385, 10, '<p>It is said that a rich man left home for a long time, entrusting the supervision of his orchard to two servants, one lame and one blind, thinking that they would not steal. But seeing themselves alone, in the absence of their master, the blind man limped on his back and thus, leading each other, they stole the most beautiful fruits from the orchard. When the master returned and saw the damage, they tried to apologize, but the master knew their deception and said to them: - Together you have sinned, together you will be punished. So is the body and the soul. The former is blind, without the light of the mind, the latter is incapable of doing anything without the limbs of the body. But together they sin and together they receive punishment.</p>', '<p>It is said that a rich man left home for a long time, entrusting the supervision of his orchard to two servants, one lame and one blind, thinking that they would not steal. But seeing themselves alone, in the absence of their master, the blind man limped on his back and thus, leading each other, they stole the most beautiful fruits from the orchard. When the master returned and saw the damage, they tried to apologize, but the master knew their deception and said to them: - Together you have sinned, together you will be punished. So is the body and the soul. The former is blind, without the light of the mind, the latter is incapable of doing anything without the limbs of the body. But together they sin and together they receive punishment.</p>', 1, '1', '0', 1648878890, NULL),
(386, 10, '<p>A man who was blind from birth once asked for a glass of milk and asked the man who brought it to him, &#39;What does milk look like?&#39; He was told, &quot;Milk is a white liquid. The blind man asked again, &quot;But what does white mean?&quot; The man said, &quot;White is the color of a swan.&quot; The blind man asked again, &quot;What is a swan? The other replied, &quot;The swan is a bird with a bent neck.&quot; &quot;But what does bent mean?&quot; The blind man asked. The man replied, &quot;I will bend my elbow and you will touch it and you will understand what it means to bend.&quot; The blind man touched the man&#39;s bent elbow and said, &quot;Now I know what milk looks like.</p>', '<p>A man who was blind from birth once asked for a glass of milk and asked the man who brought it to him, &#39;What does milk look like?&#39; He was told, &quot;Milk is a white liquid. The blind man asked again, &quot;But what does white mean?&quot; The man said, &quot;White is the color of a swan.&quot; The blind man asked again, &quot;What is a swan? The other replied, &quot;The swan is a bird with a bent neck.&quot; &quot;But what does bent mean?&quot; The blind man asked. The man replied, &quot;I will bend my elbow and you will touch it and you will understand what it means to bend.&quot; The blind man touched the man&#39;s bent elbow and said, &quot;Now I know what milk looks like.</p>', 1, '1', '0', 1648878910, NULL),
(387, 10, '<p>The trip: - What will the weather be like today? The shepherd: - It will be exactly to my taste. The trip: - How do you know it will be exactly to your taste? The shepherd: - Simple sir: after I realized that I can&#39;t have everything I want, I learned to always be satisfied with what I receive. That is why I am absolutely convinced that the weather will be exactly to my taste.</p>', '<p>The trip: - What will the weather be like today? The shepherd: - It will be exactly to my taste. The trip: - How do you know it will be exactly to your taste? The shepherd: - Simple sir: after I realized that I can&#39;t have everything I want, I learned to always be satisfied with what I receive. That is why I am absolutely convinced that the weather will be exactly to my taste.</p>', 1, '1', '0', 1648878921, NULL),
(388, 10, '<p>One day, a peasant&#39;s donkey fell into the well. The animal cried for hours, while the peasant wondered what he could do to get it out of the well. In the end, he decides. What the peasant said to himself: that the animal is already old and it&#39;s time for the fountain to be plugged, so it&#39;s not worth taking the animal out of there. He called some neighbors to help him. Each took a shovel and began to throw earth into the fountain. Understanding what was happening, the donkey started screaming and then, to everyone&#39;s surprise, he calmed down. After a while, the peasant looked into the fountain and was very surprised to see that, after each shovel, the donkey shook and stepped a step higher. After a while, the world was amazed, when the donkey reached the top, stepped over the edge of the fountain, coming out very well, strengthen us and get closer and closer to the light, to God.</p>', '<p>One day, a peasant&#39;s donkey fell into the well. The animal cried for hours, while the peasant wondered what he could do to get it out of the well. In the end, he decides. What the peasant said to himself: that the animal is already old and it&#39;s time for the fountain to be plugged, so it&#39;s not worth taking the animal out of there. He called some neighbors to help him. Each took a shovel and began to throw earth into the fountain. Understanding what was happening, the donkey started screaming and then, to everyone&#39;s surprise, he calmed down. After a while, the peasant looked into the fountain and was very surprised to see that, after each shovel, the donkey shook and stepped a step higher. After a while, the world was amazed, when the donkey reached the top, stepped over the edge of the fountain, coming out very well, strengthen us and get closer and closer to the light, to God.</p>', 1, '1', '0', 1648878931, NULL),
(389, 10, '<p>A long time ago, a very good boyar lived. One day, he called a peasant to him and said, &quot;Look, man, because I know your family is having a hard time, I want to help you.&quot; I give you work and I pay you very well. Do you want to work for me? &quot;Sure, boyar,&quot; replied the happy man, &quot;what must I do?&quot; Build me a house on the edge of the forest. The peasant left happily and, from that very day, set to work. The boyar gave him money for everything he had to buy. But what did the man say to himself? &quot;He is, and he doesn&#39;t see me like that, why should I cheat on him?&quot; And instead of doing everything right, he started buying cheap and bad things and spending the money he had left. When he finished, the house looked very nice on the outside, but the peasant knew that he had not done well and that, soon enough, it would break down. When he showed the boyar the house, he said to him: Because I know that you and your family live in a small hut, I am giving you this house as a gift. That&#39;s why I let you build it and I told you now, at the end, just to make your joy greater. Now the man</p>', '<p>A long time ago, a very good boyar lived. One day, he called a peasant to him and said, &quot;Look, man, because I know your family is having a hard time, I want to help you.&quot; I give you work and I pay you very well. Do you want to work for me? &quot;Sure, boyar,&quot; replied the happy man, &quot;what must I do?&quot; Build me a house on the edge of the forest. The peasant left happily and, from that very day, set to work. The boyar gave him money for everything he had to buy. But what did the man say to himself? &quot;He is, and he doesn&#39;t see me like that, why should I cheat on him?&quot; And instead of doing everything right, he started buying cheap and bad things and spending the money he had left. When he finished, the house looked very nice on the outside, but the peasant knew that he had not done well and that, so